define(["jquery","bootstrap/modal"],function(e){return{markup:'<div class="modal fade" tabindex="-1" role="dialog"> <div class="modal-dialog"> <div class="modal-content"> <div class="modal-header"> <button type="button" class="close" data-dismiss="modal" aria-label="Close"><span aria-hidden="true">&times;</span></button> <h4 class="modal-title">{{title}}</h4> </div> <div class="modal-body">{{body}} </div> <div class="modal-footer">{{footer}} </div> </div> </div> </div>',getMarkUp:function(e,t,n){return this.markup.replace("{{title}}",e).replace("{{body}}",t).replace("{{footer}}",n)}}});